import React from 'react'

export default function SectionHeader({}) {
    return (
        <div className="box section">
          Our Sections
          <button className="dots" onClick={() => setSection(1)}></button>
          <button className="dots" onClick={() => setSection(2)}></button>
        </div>
    )
}
